    constructor() {
        super();
        this.state = {
            events: []
        }
    }

    componentDidMount() {
        axios.get('api/events')
            .then((events) => {
                this.setState({ [events]: events })
            })
            .catch(error => console.log('ERROR', error))
    }

    render() {
        console.log("State events: ", this.state.events)
